import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super();
    this.title = props.title;
    this.message = props.message;
  }
  render() {
    return <div>
      <h1>React</h1>
      <p>This is sample component.</p>
      <p>これはサンプルのコンポーネントです。</p>
    </div>;
  }
}

export default App;
